import logo from './logo.svg';
import data from './data.js';
import './App.css';
import Header from './Header.js';
import Body from './Body.js';
import Footer from './Footer';

function App() {
  return (
    <div className="App">
      <Header logoSrc="big-logo.png" />
      <Body title="Trackin' state!"/>
      <Footer year="2021" />
  </div>
  );
}

export default App;
